import { RouterProvider, createBrowserRouter } from "react-router-dom";
import EditStaffPage from "./pages/EditStaff";
import ErrorPage from "./pages/Error";
import StaffDetailPage, {
  loader as staffDetailLoader,
} from "./pages/StaffDetail";
import StaffsPage, { loader as staffsLoader } from "./pages/Staffs";
import StaffRootLayout from "./pages/StaffRoot";
import HomePage from "./pages/Home";
import NewStaffPage from "./pages/NewStaff";
import RootLayout from "./pages/Root";

const router = createBrowserRouter([
  {
    path: "/",
    element: <RootLayout />,
    errorElement: <ErrorPage />,
    children: [
      { index: true, element: <HomePage /> },
      {
        path: "staffs",
        element: <StaffRootLayout />,
        children: [
          {
            index: true,
            element: <StaffsPage />,
            loader: staffsLoader,
          },
          {
            path: ":staffno",
            id: "staff-detail",
            loader: staffDetailLoader,
            children: [
              {
                index: true,
                element: <StaffDetailPage />,
              },
              {
                path: "edit",
                element: <EditStaffPage />,
              },
            ],
          },
          {
            path: "new",
            element: <NewStaffPage />,
          },
        ],
      },
    ],
  },
]);

function App() {
  return <RouterProvider router={router} />;
}

export default App;
